custom-global-css:
// Spacing overrides
:root {
  --space-xxs: 0.8rem;
  --space-xs: 1.6rem;
  --space-s: 2.4rem;
  --space-m: 3.2rem;
  --space-l: 4.0rem;
  --space-xl: 4.8rem;
  --space-xxl: 5.6rem;
  --space-3xl: 6.4rem;
  --space-4xl: 7.2rem;
  --space-5xl: 8.0rem;
  --space-6xl: 8.8rem;
  --space-7xl: 9.6rem;
  --space-8xl: 10.4rem;
  --space-9xl: 11.2rem;
  --space-10xl: 12rem;
  --space-11xl: 12.8rem;
  --space-12xl: 13.6rem;
}
.padding--xxs {
  padding: var(--space-xxs);
}
/* xs through xxl are already defined in ACSS */
.padding-3xl {
  padding: var(--space-3xl);
}
.padding-4xl {
  padding: var(--space-4xl);
}
.padding-5xl {
  padding: var(--space-5xl);
}
.padding-6xl {
  padding: var(--space-6xl);
}
.padding-7xl {
  padding: var(--space-7xl);
}
.padding-8xl {
  padding: var(--space-8xl);
}
.padding-9xl {
  padding: var(--space-9xl);
}
.padding-10xl {
  padding: var(--space-10xl);
}
.padding-11xl {
  padding: var(--space-11xl);
}
.padding-12xl {
  padding: var(--space-12xl);
}

// Button overrides
.bricks-button.btn--l:not(.wp-block-button), .wp-block-button.btn--l > a, .wp-block-button.btn--l > .wp-block-button__link{
  line-height: 1.77777778;
}
.bricks-button.btn--m:not(.wp-block-button), .wp-block-button.btn--m > a, .wp-block-button.btn--m > .wp-block-button__link{
  font-size: var(--text-s);
}
.bricks-button.btn--s:not(.wp-block-button), .wp-block-button.btn--s > a, .wp-block-button.btn--s > .wp-block-button__link{
  font-size: var(--text-xs);
  line-height: 1.33333333;
}
.bricks-button.btn--xs:not(.wp-block-button), .wp-block-button.btn--xs > a, .wp-block-button.btn--xs > .wp-block-button__link{
  line-height: 1.5;
  font-weight: 400;
  padding-block: 0.2rem;
  padding-inline: 0.8rem;
}

// Border radius overrides
:root {
  --radius-xxs: 2px;
  --radius-xs: 4px;
  --radius-s: 6px;
  --radius-l: 10px;
  --radius-xl: 12px;
  --radius-xxl: 16px;
  --radius-3xl: 20px;
  --radius-4xl: 24px;
}
.radius--xxs {
  border-radius: var(--radius-xxs);
}
/* xs through xxl are already defined in ACSS */
.radius--3xl {
  border-radius: var(--radius-3xl);
}
.radius--4xl {
  border-radius: var(--radius-4xl);
}
